"use strict";function initRegistrationTabs(){var t=document.querySelectorAll(".registration-lk__tabs [data-target]"),a=document.querySelectorAll(".registration-lk__content");t.forEach(function(i){return i.addEventListener("click",function(){t.forEach(function(t){return t===i?t.classList.add("active"):t.classList.remove("active")});var e=i.dataset.target;a.forEach(function(t){return t.id===e?t.classList.add("active"):t.classList.remove("active")})})})}window.addEventListener("load",function(){initRegistrationTabs()});